                      <h4 className="font-medium text-red-800 mb-2">Issues Found:</h4>
                      <ul className="text-sm text-red-700 space-y-1">
                        {previewData.errors.slice(0, 5).map((error, index) => (
                          <li key={index}> {error}</li>
                        ))}
                        {previewData.errors.length > 5 && (
                          <li className="text-red-600 font-medium">
                            ... and {previewData.errors.length - 5} more issues
                          </li>
                        )}
                      </ul>
                    </div>
                  )}

                  {previewData.previewUsers && previewData.previewUsers.length > 0 && (
                    <div className="bg-gray-50 border border-gray-200 rounded-md p-4 max-h-64 overflow-y-auto">
                      <h4 className="font-medium text-gray-800 mb-2">Data Preview (All {previewData.previewUsers.length} students found):</h4>
                      <div className="overflow-x-auto">
                        <table className="min-w-full text-xs">
                          <thead className="bg-gray-100">
                            <tr>
                              <th className="px-2 py-1 text-left font-medium text-gray-600">Row</th>
                              <th className="px-2 py-1 text-left font-medium text-gray-600">SL#</th>
                              <th className="px-2 py-1 text-left font-medium text-gray-600">Original Name</th>
                              <th className="px-2 py-1 text-left font-medium text-gray-600">First Name</th>
                              <th className="px-2 py-1 text-left font-medium text-gray-600">Last Name</th>
                              <th className="px-2 py-1 text-left font-medium text-gray-600">Email</th>
                              <th className="px-2 py-1 text-left font-medium text-gray-600">Subject/Major</th>
                              <th className="px-2 py-1 text-left font-medium text-gray-600">Year</th>
                              <th className="px-2 py-1 text-left font-medium text-gray-600">Student ID</th>
                            </tr>
                          </thead>
                          <tbody className="divide-y divide-gray-200">
                            {previewData.previewUsers.map((user, index) => (
                              <tr key={index} className="hover:bg-gray-50">
                                <td className="px-2 py-1 text-gray-500">{user.rowNumber}</td>
                                <td className="px-2 py-1 text-blue-600 font-medium">{user.slNumber}</td>
                                <td className="px-2 py-1 text-gray-900">{user.originalName}</td>
                                <td className="px-2 py-1 text-gray-900">{user.firstName}</td>
                                <td className="px-2 py-1 text-gray-900">{user.lastName}</td>
                                <td className="px-2 py-1 text-gray-600">{user.email}</td>
                                <td className="px-2 py-1 text-gray-900">{user.subjectMajor}</td>
                                <td className="px-2 py-1 text-gray-900">{user.yearLevel}</td>
                                <td className="px-2 py-1 text-gray-600">{user.studentId}</td>
                              </tr>
                            ))}
                          </tbody>
                        </table>
                      </div>
                    </div>
                  )}
                </div>
              )}

              {/* Upload Results */}
              {uploadResults && (
                <div className="space-y-3">
                  <div className="bg-green-50 border border-green-200 rounded-md p-4">
                    <h4 className="font-medium text-green-800 mb-2">Upload Complete!</h4>
                    <div className="text-sm text-green-700 space-y-1">
                      <p>Total rows processed: {uploadResults.summary?.totalRows || 0}</p>
                      <p>Users successfully imported: {uploadResults.summary?.insertedUsers || 0}</p>
                      <p>Errors encountered: {uploadResults.summary?.errors || 0}</p>
                    </div>
                  </div>

                  {uploadResults.errors && uploadResults.errors.length > 0 && (
                    <div className="bg-red-50 border border-red-200 rounded-md p-4 max-h-40 overflow-y-auto">
                      <h4 className="font-medium text-red-800 mb-2">Errors:</h4>
                      <ul className="text-sm text-red-700 space-y-1">
                        {uploadResults.errors.slice(0, 10).map((error, index) => (
                          <li key={index}> {error}</li>
                        ))}
                        {uploadResults.errors.length > 10 && (
                          <li className="text-red-600 font-medium">
                            ... and {uploadResults.errors.length - 10} more errors
                          </li>
                        )}
                      </ul>
                    </div>
                  )}

                  {uploadResults.insertedUsers && uploadResults.insertedUsers.length > 0 && (
                    <div className="bg-gray-50 border border-gray-200 rounded-md p-4 max-h-40 overflow-y-auto">
                      <h4 className="font-medium text-gray-800 mb-2">Successfully Imported Users:</h4>
                      <div className="text-sm text-gray-700 space-y-1">
                        {uploadResults.insertedUsers.slice(0, 5).map((user, index) => (
                          <div key={index} className="flex justify-between">
                            <span>{user.name}</span>
                            <span className="text-gray-500">{user.subject} - Year {user.year}</span>
                          </div>
                        ))}
                        {uploadResults.insertedUsers.length > 5 && (
                          <p className="text-gray-600 font-medium">
                            ... and {uploadResults.insertedUsers.length - 5} more users
                          </p>
                        )}
                      </div>
                    </div>
                  )}
                </div>
              )}

              {/* Action Buttons */}
              <div className="flex justify-end space-x-3 pt-4">
                <button
                  type="button"
                  onClick={resetUploadModal}
                  className="px-4 py-2 border border-gray-300 rounded-md text-sm font-medium text-gray-700 bg-white hover:bg-gray-50"
                  disabled={uploading}
                >
                  {uploadResults ? 'Close' : 'Cancel'}
                </button>

                {!showPreview && !uploadResults && (
                  <button
                    onClick={handleFilePreview}
                    disabled={!uploadFile || uploading}
                    className="px-4 py-2 border border-transparent rounded-md shadow-sm text-sm font-medium text-white bg-blue-600 hover:bg-blue-700 disabled:opacity-50 disabled:cursor-not-allowed"
                  >
                    {uploading ? (
                      <div className="flex items-center">
                        <div className="animate-spin rounded-full h-4 w-4 border-b-2 border-white mr-2"></div>
                        Processing...
                      </div>
                    ) : (
                      'Preview Data'
                    )}
                  </button>
                )}

                {showPreview && !uploadResults && (
                  <>
                    <button
                      onClick={() => {
                        setShowPreview(false);
                        setPreviewData(null);
                      }}
                      className="px-4 py-2 border border-gray-300 rounded-md text-sm font-medium text-gray-700 bg-white hover:bg-gray-50"
                      disabled={uploading}
                    >
                      Back to File Selection
                    </button>
                    <button
                      onClick={handleConfirmUpload}
                      disabled={uploading}
                      className="px-4 py-2 border border-transparent rounded-md shadow-sm text-sm font-medium text-white bg-green-600 hover:bg-green-700 disabled:opacity-50 disabled:cursor-not-allowed"
                    >
                      {uploading ? (
                        <div className="flex items-center">
                          <div className="animate-spin rounded-full h-4 w-4 border-b-2 border-white mr-2"></div>
                          Uploading...
                        </div>
                      ) : (
                        'Confirm Upload'
                      )}
                    </button>
                  </>
                )}
              </div>
            </div>
          </div>
        </div>
      )}

      {/* Fingerprint Assignment Modal */}
      {showFingerprintModal && selectedUser && (
        <div className="fixed inset-0 bg-gray-600 bg-opacity-50 overflow-y-auto h-full w-full z-50">
          <div className="relative top-20 mx-auto p-5 border w-full max-w-md shadow-lg rounded-md bg-white">
            <div className="flex justify-between items-center mb-4">
              <h3 className="text-lg font-semibold text-gray-900">
                Assign Fingerprint
              </h3>
              <button
                onClick={() => {
                  setShowFingerprintModal(false);
                  setSelectedUser(null);
                  setSelectedFingerprintId('');
                }}
                className="text-gray-400 hover:text-gray-600"
              >
                <XMarkIcon className="h-6 w-6" />
              </button>
            </div>

            <div className="space-y-4">
              {/* User Info */}
              <div className="bg-gray-50 border border-gray-200 rounded-md p-4">
                <h4 className="font-medium text-gray-800 mb-2">
                  {selectedUser.USERTYPE === 'instructor' ? 'Instructor' : 'Student'} Information
                </h4>
                <div className="text-sm text-gray-700 space-y-1">
                  <p><strong>Name:</strong> {selectedUser.FIRSTNAME} {selectedUser.LASTNAME}</p>
                  <p><strong>{selectedUser.USERTYPE === 'instructor' ? 'Faculty ID:' : 'Student ID:'}</strong> {selectedUser.FACULTYID || selectedUser.STUDENTID}</p>
                  <p><strong>Email:</strong> {selectedUser.EMAIL}</p>
                  <p><strong>Department:</strong> {selectedUser.DEPARTMENT}</p>
                  <p><strong>Role:</strong> {selectedUser.USERTYPE}</p>
                </div>
              </div>

              {/* Fingerprint ID Selection */}
              <div>
                <label htmlFor="fingerprint-id" className="block text-sm font-medium text-gray-700 mb-2">
                  Select Fingerprint ID (1-127)
                </label>
                <select
                  id="fingerprint-id"
                  value={selectedFingerprintId}
                  onChange={(e) => setSelectedFingerprintId(e.target.value)}
                  className="w-full px-3 py-2 border border-gray-300 rounded-md shadow-sm focus:outline-none focus:ring-blue-500 focus:border-blue-500"
                  disabled={assigningFingerprint}
                >
                  <option value="">Select a fingerprint ID...</option>
                  {availableFingerprintIds.map(id => (
                    <option key={id} value={id}>
                      Fingerprint ID #{id}
                    </option>
                  ))}
                </select>
                <p className="mt-1 text-xs text-gray-500">
                  {availableFingerprintIds.length} IDs available out of 127 total slots
                </p>
              </div>

              {/* Instructions */}
              <div className="bg-blue-50 border border-blue-200 rounded-md p-4">
                <h4 className="font-medium text-blue-800 mb-2">Instructions:</h4>
                <ol className="text-sm text-blue-700 space-y-1 list-decimal list-inside">
                  <li>Select an available fingerprint ID from the dropdown</li>
                  <li>Click "Assign Fingerprint" to save the assignment</li>
                  <li>Use the Arduino Serial Monitor to enroll the fingerprint:</li>
                  <li className="ml-4 text-xs font-mono bg-blue-100 p-1 rounded">
                    enroll {selectedFingerprintId || '[ID]'}
                  </li>
                  <li>Follow the prompts to scan the finger twice</li>
                  {selectedUser.USERTYPE === 'instructor' && (
                    <li className="text-green-700 font-medium"> Instructors get automatic lock access when scanning</li>
                  )}
                </ol>
              </div>

              {/* Action Buttons */}
              <div className="flex justify-end space-x-3 pt-4">
                <button
                  type="button"
                  onClick={() => {
                    setShowFingerprintModal(false);
                    setSelectedUser(null);
                    setSelectedFingerprintId('');
                  }}
                  className="px-4 py-2 border border-gray-300 rounded-md text-sm font-medium text-gray-700 bg-white hover:bg-gray-50"
                  disabled={assigningFingerprint}
                >
                  Cancel
                </button>
                <button
                  onClick={handleFingerprintAssignment}
                  disabled={!selectedFingerprintId || assigningFingerprint}
                  className="px-4 py-2 border border-transparent rounded-md shadow-sm text-sm font-medium text-white bg-purple-600 hover:bg-purple-700 disabled:opacity-50 disabled:cursor-not-allowed"
                >
                  {assigningFingerprint ? (
                    <div className="flex items-center">
                      <div className="animate-spin rounded-full h-4 w-4 border-b-2 border-white mr-2"></div>
                      Assigning...
                    </div>
                  ) : (
                    <>
                      <FingerPrintIcon className="h-4 w-4 mr-2" />
                      Assign Fingerprint
                    </>
                  )}
                </button>
              </div>
            </div>
          </div>
        </div>
      )}

      {/* RFID Assignment Modal */}
      {showRfidModal && (
        <div className="fixed inset-0 bg-gray-600 bg-opacity-50 overflow-y-auto h-full w-full z-50">
          <div className="relative top-20 mx-auto p-5 border w-96 shadow-lg rounded-md bg-white">
            <div className="mt-3">
              <div className="flex items-center justify-between mb-4">
                <h3 className="text-lg font-medium text-gray-900">
                  Assign RFID Card
                </h3>
                <button
                  onClick={() => setShowRfidModal(false)}
                  className="text-gray-400 hover:text-gray-600"
                >
                  <XMarkIcon className="h-6 w-6" />
                </button>
              </div>

              {selectedUser && (
                <div className="mb-4 p-3 bg-gray-50 rounded-lg">
                  <div className="text-sm font-medium text-gray-900">
                    {selectedUser.FIRSTNAME} {selectedUser.LASTNAME}
                  </div>
                  <div className="text-sm text-gray-500">
                    {selectedUser.USERTYPE === 'instructor' || selectedUser.USERTYPE === 'admin' 
                      ? (selectedUser.FACULTYID || 'No Faculty ID') 
                      : (selectedUser.STUDENTID || 'No Student ID')
                    }  {selectedUser.EMAIL}
                  </div>
                  <div className="text-sm text-gray-500">
                    Role: {selectedUser.USERTYPE}
                  </div>
                  {selectedUser.RFIDTAG && (
                    <div className="text-sm text-blue-600 mt-1">
                      Current RFID: {selectedUser.RFIDTAG}
                    </div>
                  )}
                  {(selectedUser.USERTYPE === 'instructor' || selectedUser.USERTYPE === 'admin') && (
                    <div className="text-sm text-green-600 mt-1">
                       RFID access will control solenoid lock
                    </div>
                  )}
                </div>
              )}

              <div className="space-y-4">
                {/* Scan Mode */}
                <div>
                  <label className="block text-sm font-medium text-gray-700 mb-2">
                    Scan RFID Card
                  </label>
                  <div className="flex space-x-2">
                    <button
                      onClick={handleStartRfidScan}
                      disabled={rfidScanMode}
                      className={`flex-1 px-4 py-2 text-sm font-medium rounded-md transition-colors duration-200 ${
                        rfidScanMode
                          ? 'bg-green-100 text-green-800 cursor-not-allowed'
                          : 'bg-blue-600 text-white hover:bg-blue-700'
                      }`}
                    >
                      {rfidScanMode ? (
                        <div className="flex items-center justify-center">
                          <div className="animate-spin rounded-full h-4 w-4 border-b-2 border-green-600 mr-2"></div>
                          Scanning...
                        </div>
                      ) : (
                        <>
                          <CreditCardIcon className="h-4 w-4 mr-2 inline" />
                          Start Scan
                        </>
                      )}
                    </button>
                  </div>
                  {rfidScanMode && (
                    <div className="mt-2 text-sm text-green-600">
                       Scan mode active - scan your RFID card now!
                    </div>
                  )}
                  {scannedRfidData && (
                    <div className="mt-2 text-sm text-green-600">
                       Captured: {scannedRfidData}
                    </div>
                  )}
                </div>

                {/* Manual Input */}
                <div>
                  <label className="block text-sm font-medium text-gray-700 mb-2">
                    Or Enter Manually
                  </label>
                  <input
                    type="text"
                    value={manualRfidInput}
                    onChange={(e) => setManualRfidInput(e.target.value)}
                    placeholder="Enter RFID code manually"
                    className="w-full px-3 py-2 border border-gray-300 rounded-md shadow-sm focus:outline-none focus:ring-blue-500 focus:border-blue-500"
                  />
                </div>
              </div>

              <div className="flex justify-end space-x-3 mt-6">
                <button
                  onClick={() => setShowRfidModal(false)}
                  className="px-4 py-2 text-sm font-medium text-gray-700 bg-gray-100 rounded-md hover:bg-gray-200 transition-colors duration-200"
                >
                  Cancel
                </button>
                <button
                  onClick={handleAssignRfid}
                  disabled={assigningRfid || (!scannedRfidData && !manualRfidInput.trim())}
                  className="px-4 py-2 text-sm font-medium text-white bg-blue-600 rounded-md hover:bg-blue-700 disabled:opacity-50 disabled:cursor-not-allowed transition-colors duration-200"
                >
                  {assigningRfid ? (
                    <div className="flex items-center">
                      <div className="animate-spin rounded-full h-4 w-4 border-b-2 border-white mr-2"></div>
                      Assigning...
                    </div>
                  ) : (
                    <>
                      <CreditCardIcon className="h-4 w-4 mr-2 inline" />
                      Assign RFID
                    </>
                  )}
                </button>
              </div>
            </div>
          </div>
        </div>
      )}

      {/* Hidden input for RFID scanning */}
      <input
        id="rfid-scan-input"
        type="text"
        onKeyPress={handleRfidScanInput}
        style={{
          position: 'absolute',
          left: '-9999px',
          opacity: 0,
          pointerEvents: 'none'
        }}
      />
    </div>
  );
}

export default Users;
